import logo from './assets/logo.png'

const Header = () => {
    return (
        <div className="header">
            <div className="nav">
                <div className="nav-logo">
                    {/* <img src={logo}></img> */}
                </div>
                <div className="nav-items">
                    <p>Heading</p>
                </div>
            </div>
        </div>
    );
}

export default Header;
